VALUES
	(28,47.49590344785,8.7187109273531,'Ghetto Lovestory (1/4)','Eine Foto-Lovestory in 4 Teilen.\n---\nWie auch schon Romeo und Julia \nsitzen neue Geliebte da\nEine wahre Liebesgeschicht\nVerpasst man am liebsten nicht\nDeshalb sollt ihr mir\nMachen eine Foto-Love-Story hier\nDafür habt ihr an vier Orten Zeit\nAuf das euch die Karte gut geleit',NULL,NULL,NULL,0,'MULTI',150,0,1),
	(29,47.494417410088,8.7161641698934,'Ghetto Lovestory (2/4)','Well mer da im Ghetto sind\nSegis oi jetz ganz gschwind\nEs bizzli Jugenddütsch derf si\nMit dem isch de poste scho verbi',28,'',NULL,0,'MULTI',150,0,1),
	(30,47.49487409934,8.7139969450094,'Ghetto Lovestory (3/4)','Ich hoff es isch nid nur Schnulze pur\nAber au nid Action nur\nDrum lönd oiere Kreativität freie Lauf\nDstory mun guet si dasi si chauf',29,'',NULL,0,'MULTI',150,0,1),
	(31,47.495276417533,8.7121945005514,'Ghetto Lovestory (4/4)','Die Endpose mun de Hammer si\nWell etz ischs denn grad verbi\nMit dem Foti na pünktli sammle\nDas oii Hood da nid mun vergammle',30,'',NULL,0,'MULTI',150,0,1),
	(32,47.499916328951,8.7341524774071,'Logical Teil 1','Hinweise:\n1.	De Graffitti-Artist het nid gern Rüebli\n2.	De Skater staht a erster Position\n3.	De Mafiaboss staht nebed zwei Künstler\n\nFrage: Wie heisst de Rapper?',NULL,'1','[\"Patrick\",\"Yuri Huber\",\"Ruedi\",\"Hans-Jakob Meier\"]',1,'MULTI',200,1,0),
	(34,47.497979190525,8.7238340193268,'Logical Teil 2','Hinweise:\n4.	De Hans-Jakob Meier isst de Burger nid\n5.	De Patrick Schmid staht rechts nebed de Person wos Rüebli isst.\n6.	E Person am Rand isst es Glace\n7.	De Yuri Huber staht a de 4. Position\n\nFrage:\nWas isst de Graffiti Artist?',NULL,'3','[\"Burger\",\"Glace\",\"R\\u00fcebli\",\"n\\u00fct\"]',1,'MULTI',200,1,0),
	(35,47.50090753339,8.7277393156525,'Logical Teil 3','Hinweise:\n8.	De Skater isst nüt ungsunds\n9.	De Patrick het d’Händ frei\n10.	De Mafia-Boss het keis H im Name\n11.	De Rapper staht rechts vom Ruedi\n\nFrage:\nWer staht Links vom Yuri Huber?',NULL,'0','[\"Mafiaboss\",\"Skater\",\"Graffiti Artist\",\"Rapper\"]',1,'MULTI',200,1,0),
	(36,47.499201006353,8.7181745583053,'Gangster Logik','Finde das Rätsel. Du musst in den Underground gehen um es zu finden. Wenn du es gelöst hast, kannst du hier die Lösung eingeben:',NULL,'2','[\"Die Summe ist 3 oder 4\",\"Die Summe ist 5 oder 6\",\"Die Summe ist 7 oder 8\",\"Die Summe ist 9 oder 10\"]',1,'SINGLE',400,1,0),
	(37,47.500617605737,8.7243275457855,'#piosx19','Bei welchen 2 fehlt etwas? #piosx19',NULL,'1','[\"Fussboden & Champagner\",\"Hand & BMW\",\"Texten & Winterthur\",\"Audi & Essen\"]',1,'SINGLE',400,1,0);
